function List() {
    const review = [['reviewer1', 'This is good'], ['reviewer2', 'This is very good']]
    const reviews = review.map((r, index) => <li key = {index}>{r}</li>);
    return (<div>
        <ul>{reviews}</ul>
    </div>);
}
export default List;
